import '../style/table.css'
import Tbody from "./Tbody";

const Table = () => {
    return (
        <div className="table">
            <section className="table__body">
                <table>
                    <thead>
                    <tr>
                        <th> Id</th>
                        <th> Customer </th>
                        <th> Location </th>
                        <th> Order Date </th>
                        <th> Status </th>
                        <th> Amount </th>
                    </tr>
                    </thead>
                    <Tbody/>
                </table>
            </section>
        </div>
    );
};

export default Table;
